function T = dateExamplesTable()
    % dateExamplesTable Create example table for testing
    
    % Copyright 2020 MathWorks, Inc.
    
    S = struct(...
        'yyyyMMdd_HHmmssdotSSSS', { "2002-02-01 12:18:33.1234", "2013-05-05 23:05:44.9876"}, ...
        'yyyyMMdd_HHmmss', { "2002-02-01 12:18:33", "2013-05-05 23:05:44"}, ...
        'yyyyMMdd_HHmm', { "2002-02-01 12:18", "2013-05-05 23:05"}, ...
        'yyyyMMdd', { "2002-02-01", "2013-05-05"}, ...
        'ddMMyyyy', { "01-02-2002", "05-05-2013"}, ...
        'TimeZone', { "GMT", "EST" } ...
        );
    T = struct2table(S);
end
